import React, { Component } from 'react';
import axios from 'axios';

class Home extends Component {
    
  
    state = { 
        platform:''
        
    }
    
    componentDidMount() {
    axios.get(`http://localhost:5000/api/v1/profile/`)
      .then(res => this.setState({platform: res.data}
       )
      )}
      
    render() { 
        return (<div className="nav" >
        <h1>APEXER</h1>
        <label for="platform">Choose Platform: </label>
        <select id="platform">
  <option value="psn" onSelect={this.state.platform} value="psn">Playstation</option>
  <option value="xbl" onSelect={this.state.platform}  value="xbl">Xbox</option>
  <option value="origin" onSelect={this.state.platform}  value="origin">Origin</option>
</select>
<br></br>
        <label for="username">Username: </label>
        <input id="username" placeholder="Enter Username"/>
        <img src="https://netduma.com/assets/uploads/Apex_Banner_2-2.jpg"></img>
        </div>
        );
    }
}

export default Home;
